/*global caches, self, Promise, */
var cacheName="lovespy-muicss-offline";self.addEventListener("install",function(event){var indexPage=new Request("index.html");event.waitUntil(fetch(indexPage).then(function(response){return caches.open(cacheName).then(function(cache){console.log("[sw.js] Cached index page during install: "+response.url);return cache.put(indexPage,response);});}));});self.addEventListener("fetch",function(event){var updateCache=function(request){return caches.open(cacheName).then(function(cache){return fetch(request,{credentials:"include",redirect:"follow"}).then(function(response){console.log("[sw.js] Add page to offline: "+response.url);return cache.put(request,response);});});};event.waitUntil(updateCache(event.request));event.respondWith(fetch(event.request).catch(function(error){console.log("[sw.js] Network request Failed. Serving content from cache: "+error);return caches.open(cacheName).then(function(cache){return cache.match(event.request).then(function(matching){var report=!matching||matching.status==404?Promise.reject("no-match"):matching;return report;});});}));});
